import ItemListContainer from '../../containers/ItemListContainer/ItemListContainer';
import Item from '../Item/Item'

const ItemDetail = ({items}) => {
return(
    <div>
        <Item
        key = {item.ItemId}
       item = {items}
        />
    </div>
    
)


};

export default ItemDetail;
